import React from "react";

import FormInput from "src/components/form-input/FormInput";
import FormButton from "src/components/button/FormButton";

import "src/components/signup/signup.styles.scss";

class SignUp extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      email: "",
      password: "",
      confirmPassword: "",
      displayName: "",
    };
  }

  handleSignUpFormInputChanged = () => {};
  handleSubmitSignUpForm = () => {};

  render() {
    const { email, displayName, password, confirmPassword } = this.state;

    return (
      <div className="sign-up">
        <form onSubmit={this.handleSubmitSignUpForm}>
          <FormInput
            type="text"
            name="displayName"
            label="Display Name"
            value={displayName}
            onHandleChange={this.handleSignUpFormInputChanged}
            required
          />
          <FormInput
            type="email"
            name="email"
            label="Email"
            value={email}
            onHandleChange={this.handleSignUpFormInputChanged}
            required
          />
          <FormInput
            type="password"
            name="password"
            label="Password"
            value={password}
            onHandleChange={this.handleSignUpFormInputChanged}
            required
          />
          <FormInput
            type="password"
            name="confirmPassword"
            label="Confirm Password"
            value={confirmPassword}
            onHandleChange={this.handleSignUpFormInputChanged}
            required
          />
          <FormButton type="submit">SIGN UP</FormButton>
        </form>
      </div>
    );
  }
}

export default SignUp;
